if(typeof(SPCYEND_libraries_subs)==="undefined"){var SPCYEND_libraries_subs={}}SPCYEND_libraries_subs.check=function(e,a,b,c){if(a===false){return true}subscriptions=SPCYEND_libraries_subs.read_file(e);if(subscriptions===false){return false}var d=subscriptions.length;for(j=0;j<d;j++){if((subscriptions[j].id.toString()===b)&&(subscriptions[j].sub===c)){return true}}return false};SPCYEND_libraries_subs.read_file=function(extension){var xmlhttp;if(window.XMLHttpRequest){xmlhttp=new XMLHttpRequest()}else{xmlhttp=new ActiveXObject("Microsoft.XMLHTTP")}var url="components/"+extension+"/helpers/subs/subs.txt";url=url+((/\?/).test(url)?"&":"?")+(new Date()).getTime();xmlhttp.open("GET",url,false);xmlhttp.send();if(xmlhttp.status===200){subscriptions_json=xmlhttp.responseText;return eval(subscriptions_json)}else{return false}};